import pytest
import math

from ashapi import Vec3, Euler, Quat, euler2quat, quat2euler


def test_euler2quat_zero_rotation():

    e = Euler()
    q = euler2quat(e)

    assert q == [0, 0, 0, 1]


def test_quat2euler_zero_rotation():

    q = Quat()
    e = quat2euler(q)

    assert e == [0, 0, 0]


def test_euler2quat():

    e = Euler(90, 0, 0)

    qh = Quat().make_rotate(math.radians(e.heading), Vec3(0, 0, 1))
    qp = Quat().make_rotate(math.radians(e.pitch), Vec3(0, 1, 0))
    qr = Quat().make_rotate(math.radians(e.roll), Vec3(1, 0, 0))

    expected = qr * qp * qh

    q = euler2quat(e)

    assert q.equals(expected) or q.equiv(expected)


