def test_euler2quat_huge_set(heading, pitch, roll):

    e = Euler(heading, pitch, roll)

    qh = Quat().make_rotate(math.radians(heading), Vec3(0, 0, 1))
    qp = Quat().make_rotate(math.radians(pitch), Vec3(0, 1, 0))
    qr = Quat().make_rotate(math.radians(roll), Vec3(1, 0, 0))

    expected = qr * qp * qh

    q = euler2quat(e)

    assert q.equals(expected) or q.equiv(expected)


def test_quat2euler2quat():

    q = Quat(0, 0.70710678118655, 0, -0.707106781186550)
    e = quat2euler(q)
    q1 = euler2quat(e)

    assert q.equals(q1) or q.equiv(q1)



